import React, { useState, useEffect } from 'react';
import { useSearchParams } from 'react-router-dom';
import Navbar from '../components/Navbar';
import PropertyCard from '../components/PropertyCard';
import { useTheme } from '../contexts/ThemeContext';
import { motion } from 'framer-motion';

const Buy = () => {
  const [properties, setProperties] = useState([]);
  const [loading, setLoading] = useState(true);
  const [error, setError] = useState(null);
  const [searchParams, setSearchParams] = useSearchParams();
  const { isDarkMode } = useTheme();
  
  // Extract filters from URL query params
  const city = searchParams.get('city') || '';
  const propertyType = searchParams.get('propertyType') || '';
  const minPrice = searchParams.get('minPrice') || '';
  const maxPrice = searchParams.get('maxPrice') || '';
  const bedrooms = searchParams.get('bedrooms') || '';
  
  // Filter state
  const [filters, setFilters] = useState({
    city,
    propertyType,
    minPrice,
    maxPrice,
    bedrooms,
  });
  
  const handleFilterChange = (e) => {
    const { name, value } = e.target;
    setFilters(prev => ({
      ...prev,
      [name]: value
    }));
  };
  
  const applyFilters = () => {
    const params = new URLSearchParams();
    
    if (filters.city) params.append('city', filters.city);
    if (filters.propertyType) params.append('propertyType', filters.propertyType);
    if (filters.minPrice) params.append('minPrice', filters.minPrice);
    if (filters.maxPrice) params.append('maxPrice', filters.maxPrice);
    if (filters.bedrooms) params.append('bedrooms', filters.bedrooms);
    
    setSearchParams(params);
  };
  
  const resetFilters = () => {
    setFilters({
      city: '',
      propertyType: '',
      minPrice: '',
      maxPrice: '',
      bedrooms: '',
    });
    setSearchParams({});
  };
  
  useEffect(() => {
    // Mock data loading
    setTimeout(() => {
      const mockProperties = Array.from({ length: 9 }, (_, i) => ({
        _id: `property-${i + 1}`,
        title: `Beautiful Property in ${city || 'Kyiv'}`,
        price: 300000 + (i * 75000),
        listingType: 'sale',
        propertyType: ['apartment', 'house', 'penthouse', 'studio'][i % 4],
        bedrooms: 1 + (i % 4),
        bathrooms: 1 + (i % 3),
        location: {
          city: city || 'Kyiv',
        },
        images: [`https://via.placeholder.com/800x600/F8FAFC/E2E8F0?text=Property+${i + 1}`],
      }));
      
      // Apply filtering
      let filtered = [...mockProperties];
      
      if (propertyType) {
        filtered = filtered.filter(p => p.propertyType === propertyType);
      }
      
      if (minPrice) {
        filtered = filtered.filter(p => p.price >= parseInt(minPrice));
      }
      
      if (maxPrice) {
        filtered = filtered.filter(p => p.price <= parseInt(maxPrice));
      }
      
      if (bedrooms) {
        filtered = filtered.filter(p => p.bedrooms === parseInt(bedrooms));
      }
      
      setProperties(filtered);
      setLoading(false);
    }, 500);
  }, [city, propertyType, minPrice, maxPrice, bedrooms]);
  
  return (
    <div className="min-h-screen bg-theme-primary text-theme-primary">
      <Navbar />
      
      <main className="container mx-auto px-4 py-8">
        <h1 className="text-3xl font-bold mb-4">Properties for Sale</h1>
        
        <div className="flex flex-col md:flex-row gap-6">
          {/* Filter Sidebar */}
          <motion.div 
            className="md:w-1/4 md:min-w-64 bg-white dark:bg-gray-800 rounded-lg shadow-md p-6 h-fit"
            initial={{ opacity: 0, x: -20 }}
            animate={{ opacity: 1, x: 0 }}
            transition={{ duration: 0.3 }}
          >
            <h2 className="text-xl font-semibold mb-6 border-b pb-2">Filters</h2>
            
            <div className="space-y-6">
              <div>
                <label htmlFor="city" className="block text-sm font-medium mb-2">Location</label>
                <input
                  type="text"
                  id="city"
                  name="city"
                  value={filters.city}
                  onChange={handleFilterChange}
                  placeholder="Enter city"
                  className="w-full p-2 border rounded-md focus:ring-2 focus:ring-blue-500 focus:outline-none"
                />
              </div>
              
              <div>
                <label htmlFor="propertyType" className="block text-sm font-medium mb-2">Property Type</label>
                <select
                  id="propertyType"
                  name="propertyType"
                  value={filters.propertyType}
                  onChange={handleFilterChange}
                  className="w-full p-2 border rounded-md focus:ring-2 focus:ring-blue-500 focus:outline-none"
                >
                  <option value="">Any Type</option>
                  <option value="apartment">Apartment</option>
                  <option value="house">House</option>
                  <option value="penthouse">Penthouse</option>
                  <option value="studio">Studio</option>
                </select>
              </div>
              
              <div>
                <label className="block text-sm font-medium mb-2">Price Range</label>
                <div className="flex items-center gap-2">
                  <input
                    type="number"
                    name="minPrice"
                    value={filters.minPrice}
                    onChange={handleFilterChange}
                    placeholder="Min"
                    className="w-full p-2 border rounded-md focus:ring-2 focus:ring-blue-500 focus:outline-none"
                  />
                  <span>-</span>
                  <input
                    type="number"
                    name="maxPrice"
                    value={filters.maxPrice}
                    onChange={handleFilterChange}
                    placeholder="Max"
                    className="w-full p-2 border rounded-md focus:ring-2 focus:ring-blue-500 focus:outline-none"
                  />
                </div>
              </div>
              
              <div>
                <label htmlFor="bedrooms" className="block text-sm font-medium mb-2">Bedrooms</label>
                <select
                  id="bedrooms"
                  name="bedrooms"
                  value={filters.bedrooms}
                  onChange={handleFilterChange}
                  className="w-full p-2 border rounded-md focus:ring-2 focus:ring-blue-500 focus:outline-none"
                >
                  <option value="">Any</option>
                  <option value="1">1</option>
                  <option value="2">2</option>
                  <option value="3">3</option>
                  <option value="4">4+</option>
                </select>
              </div>
              
              <div className="flex flex-col space-y-3 pt-4">
                <button
                  onClick={applyFilters}
                  className="w-full bg-blue-600 text-white py-2 px-4 rounded-md hover:bg-blue-700 transition duration-200"
                >
                  Apply Filters
                </button>
                <button
                  onClick={resetFilters}
                  className="w-full bg-gray-200 text-gray-800 dark:bg-gray-700 dark:text-white py-2 px-4 rounded-md hover:bg-gray-300 dark:hover:bg-gray-600 transition duration-200"
                >
                  Reset Filters
                </button>
              </div>
            </div>
          </motion.div>
          
          {/* Property Listings */}
          <div className="md:w-3/4">
            {city && <p className="mb-6">Location: {city}</p>}
            
            {loading ? (
              <div className="grid grid-cols-1 md:grid-cols-2 lg:grid-cols-3 gap-6">
                {Array.from({ length: 6 }).map((_, i) => (
                  <div 
                    key={i} 
                    className="h-80 rounded-lg animate-pulse" 
                    style={{ backgroundColor: isDarkMode ? '#374151' : '#E5E7EB' }}
                  />
                ))}
              </div>
            ) : properties.length === 0 ? (
              <div className="text-center py-12">
                <h3 className="text-xl mb-2">No properties found</h3>
                <p className="mb-4">Try adjusting your filters or search criteria</p>
                <button 
                  onClick={resetFilters}
                  className="bg-blue-600 text-white px-4 py-2 rounded hover:bg-blue-700"
                >
                  Clear Filters
                </button>
              </div>
            ) : (
              <div className="grid grid-cols-1 md:grid-cols-2 lg:grid-cols-2 gap-6">
                {properties.map(property => (
